import { useRef } from 'react';
import { Box, Grid, Stack, Input, IconButton } from '@chakra-ui/core';
import FormLayout from '../lib/FormLayout';

const SignInForm = () => {
  const ref = useRef('');
  const [status, setStatus] = useState(false);

  return (
    <Stack spacing="2rem" paddingBottom="2rem">
      <FormLayout>
        <Box>
          <StyledInput type="text" placeholder="Product" isDisabled={status} />
          <StyledInput
            type="number"
            placeholder="Quantity"
            isDisabled={status}
          />
        </Box>
      </FormLayout>
    </Stack>
  );
};

export default SignInForm;
